import { Button } from "@mui/material";
import React from "react";
import { useNavigate } from "react-router-dom";

export const Home = () => {
  const navigate = useNavigate();
  const handleClick = () => {
    navigate("/login");
  };
  return (
    <div>
      <h1>Page1</h1>
      <Button onClick={handleClick} variant="contained" fullWidth>
        ADDD
      </Button>
    </div>
  );
};
